styles:
.sky-list-view-checklist-item {
  display: block;
  width: 100%;
  cursor: pointer;
}

.sky-list-view-checklist-item:last-child {
  border-bottom-width: 0;
}

.sky-list-view-checklist-item /deep/ sky-checkbox {
  display: block;
  position: relative;
  width: 100%;
  padding: 10px;
  cursor: pointer;
  border-bottom: 1px dotted #cdcfd2;
}

.sky-list-view-checklist-item /deep/ sky-checkbox-label {
  flex: 1;
  position: relative;
  overflow: hidden;
  white-space: nowrap;
  cursor: pointer;
  padding-left: 10px;
}

.sky-list-view-checklist-item /deep/ sky-checkbox-label div {
  overflow: hidden;
  text-overflow: ellipsis;
}

.sky-list-view-checklist-item /deep/ .sky-list-view-checklist-single-button {
  background-color: transparent;
  border: none;
  border-bottom: 1px dotted #cdcfd2;
  display: block;
  text-align: left;
  margin-bottom: 0;
  padding: 10px;
  width: 100%;
  cursor: pointer;
}

.sky-list-view-checklist-item /deep/ .sky-list-view-checklist-single-button.sky-list-view-checklist-row-selected {
  background-color: #f1eef6;
}

